import React from "react";
import {
  Box,
  Container,
  Grid,
  Typography,
  Card,
  CardContent,
} from "@material-ui/core";
import styles from "./Offer.module.css";

const Offer = () => {
  const offerData = [
    {
      title: "BASIC",
      offer1: "OFFER1",
      price1: "RS.XX",
      offer2: "OFFER2",
      price2: "RS.XX",
      offer3: "OFFER3",
      price3: "RS.XX",
      offer4: "OFFER4",
      price4: "RS.XX",
      offer5: "OFFER5",
      price5: "RS.XX",
    },
    {
      title: "STANDARD",
      offer1: "OFFER1",
      price1: "RS.XX",
      offer2: "OFFER2",
      price2: "RS.XX",
      offer3: "OFFER3",
      price3: "RS.XX",
      offer4: "OFFER4",
      price4: "RS.XX",
      offer5: "OFFER5",
      price5: "RS.XX",
    },
    {
      title: "PREMIUM",
      offer1: "OFFER1",
      price1: "RS.XX",
      offer2: "OFFER2",
      price2: "RS.XX",
      offer3: "OFFER3",
      price3: "RS.XX",
      offer4: "OFFER4",
      price4: "RS.XX",
      offer5: "OFFER5",
      price5: "RS.XX",
    },
  ];
  return (
    <div>
      <Box>
        <Typography className={styles.title}>MY OFFERS</Typography>
      </Box>
      <Container maxWidth="md">
        <Grid container className={styles.container}>
          {offerData.map((offer) => {
            return (
              <Grid item xs={12} sm={4} md={4}>
                <Card className={styles.offerCard}>
                  <CardContent>
                    <Typography>{offer.title}</Typography>
                    <Typography className={styles.offer}>
                      {offer.offer1} = {offer.price1}
                    </Typography>
                    <Typography className={styles.offer}>
                      {offer.offer2} = {offer.price2}
                    </Typography>
                    <Typography className={styles.offer}>
                      {offer.offer3} = {offer.price3}
                    </Typography>
                    <Typography className={styles.offer}>
                      {offer.offer4} = {offer.price4}
                    </Typography>
                    <Typography className={styles.offer}>
                      {offer.offer5} = {offer.price5}
                    </Typography>
                    <hr />
                    <Typography className={styles.offer}>
                      Total = RS.XXX
                    </Typography>
                  </CardContent>
                </Card>
              </Grid>
            );
          })}
        </Grid>
      </Container>
    </div>
  );
};

export default Offer;
